    const [searchParams ]= useSearchParams();
    console.warn(searchParams.get('age'))
    console.warn(searchParams.get('city'))
    const age= searchParams.get('age');
    const city = searchParams.get('city')

    return(
        <div>
            <h2>filter page</h2>
            <h2>Age is : {age}</h2>
            <h2>city is : {city}</h2>
        </div>
    );
}
export default Filter;
